function json(jsonFilePath)
    local class = {}
    function class:Save(t)
        file = io.open(jsonFilePath, "w")
        file:write(encodeJson(t or {}))
        file:flush()
        file:close()
    end

    function class:Load(defaultTable)
        if not doesFileExist(jsonFilePath) then class:Save(defaultTable or {}) end
        local file = io.open(jsonFilePath, "r+")
        local jsonInString = file:read("*a")
        file:close()
        local jsonTable = decodeJson(jsonInString)
        for def_k, def_v in pairs(defaultTable) do
            if jsonTable[def_k] == nil then
                jsonTable[def_k] = def_v
                print('Key "'..def_k..'" does not exists in jsonTable!')
                class:Save(jsonTable)
            end
        end
        return jsonTable
    end

    return class
end



