function imgui.FunctionChild(title, description, bool, size, colors)
    local colors = {
        back = imgui.ImVec4(0.13, 0.16, 0.2, 1),
        line = imgui.ImVec4(1, 0, 0.3, 1),
        text = imgui.ImVec4(1, 1, 1, 1),
        textd = imgui.ImVec4(0.5, 0.5, 0.5, 1),
    }
    local c = imgui.GetCursorPos()
    local p = imgui.GetCursorScreenPos()
    local dl = imgui.GetWindowDrawList()

    dl:AddRectFilled(p, imgui.ImVec2(p.x + size.x, p.y + size.y), imgui.GetColorU32Vec4(colors.back), 5, 2 + 8)
    dl:AddRectFilled(p, imgui.ImVec2(p.x + 5, p.y + size.y), imgui.GetColorU32Vec4(colors.line), 5, 1 + 4)

    dl:AddText(imgui.ImVec2(p.x + 10, p.y + 10), imgui.GetColorU32Vec4(colors.text), title)
    dl:AddText(imgui.ImVec2(p.x + 10, p.y + 25), imgui.GetColorU32Vec4(colors.textd), description)

    imgui.SetCursorPos(imgui.ImVec2(c.x + size.x - 20 - 10, c.y + 10))
    if bool ~= nil then
        imgui.Checkbox('##'..title..'::'..description, bool) 
    end

    imgui.SetCursorPos(imgui.ImVec2(c.x + 10, c.y + 20 + 25))
    imgui.BeginChild('child:controls:'..title..':'..description, imgui.ImVec2(size.x - 15, size.y - 25 - 25), false)
end

function imgui.CloseButton(size, thickness, textColor, color, colorHovered, colorClicked)
    local col = {
        text = textColor or imgui.GetStyle().Colors[imgui.Col.Button],
        color = color or imgui.GetStyle().Colors[imgui.Col.Button],
        colorHovered = colorHovered or imgui.GetStyle().Colors[imgui.Col.ButtonHovered],
        colorClicked = colorClicked or imgui.GetStyle().Colors[imgui.Col.ButtonActive],
    }
    local c = imgui.GetCursorPos()
    local p = imgui.GetCursorScreenPos()
    local DL = imgui.GetWindowDrawList()
    local tx = imgui.CalcTextSize('X')
    local curX, curY = getCursorPos()
    DL:AddCircle(p, size, imgui.GetColorU32Vec4(col.color), 100, thickness)
    if curX > p.x - size and curX < p.x + size then
        if curY > p.y - size and curY < p.y + size then
            DL:AddLine(imgui.ImVec2(p.x - size + thickness, p.y - size + thickness), imgui.ImVec2(p.x + size - thickness, p.y + size - thickness), imgui.GetColorU32Vec4(col.color), thickness)
            DL:AddLine(imgui.ImVec2(p.x + size - thickness, p.y - size + thickness), imgui.ImVec2(p.x - size + thickness, p.y + size - thickness), imgui.GetColorU32Vec4(col.color), thickness)
        end
    end
    imgui.SetCursorPos(imgui.ImVec2(c.x - size, c.y - size))
    return imgui.InvisibleButton('CLOSEBUTTONBEBRA', imgui.ImVec2(size * 2, size * 2))
end

function imgui.BarWithIcon(str, value, icon, size, color, colorback, outSize, iconColor, drawValue, round, maxValue)
    local dl = imgui.GetWindowDrawList()
    local c = imgui.GetCursorPos()
    local p = imgui.GetCursorScreenPos()

    local oneSize = size.x / 100

    dl:AddRectFilled(p, imgui.ImVec2(p.x + size.x, p.y + size.y), imgui.GetColorU32Vec4(colorback), round or 0)
    --dl:AddRectFilled(imgui.ImVec2(p.x + outSize, p.y + outSize), imgui.ImVec2(p.x + value * oneSize - outSize, p.y + size.y - outSize), imgui.GetColorU32Vec4(color))
    if str == 'hp' then
        dl:AddRectFilledMultiColor(imgui.ImVec2(p.x + outSize, p.y + outSize), imgui.ImVec2(p.x + value * oneSize - outSize, p.y + size.y - outSize), imgui.GetColorU32Vec4(imgui.ImVec4(0, 0.66, 0.01, 1)), imgui.GetColorU32Vec4(imgui.ImVec4(0.16, 0.79, 0, 1)), imgui.GetColorU32Vec4(imgui.ImVec4(0.15, 0.79, 0, 1)), imgui.GetColorU32Vec4(imgui.ImVec4(0, 0.66, 0.01, 1)));
    elseif str == 'armour' then
        dl:AddRectFilledMultiColor(imgui.ImVec2(p.x + outSize, p.y + outSize), imgui.ImVec2(p.x + value * oneSize - outSize, p.y + size.y - outSize), imgui.GetColorU32Vec4(imgui.ImVec4(0.07, 0.55, 0.89, 1)), imgui.GetColorU32Vec4(imgui.ImVec4(0.07, 0.82, 1, 1)), imgui.GetColorU32Vec4(imgui.ImVec4(0.07, 0.82, 1, 1)), imgui.GetColorU32Vec4(imgui.ImVec4(0.07, 0.55, 0.89, 1)));
    else
        if value > 0 then
            if value > (maxValue or 100) then value = (maxValue or 100) end
            dl:AddRectFilled(imgui.ImVec2(p.x + outSize, p.y + outSize), imgui.ImVec2(p.x + value * oneSize - outSize, p.y + size.y - outSize), imgui.GetColorU32Vec4(color), round)
        end
    end
    if s.bars_display_icons[0] then
        local iconSize = imgui.CalcTextSize(icon)
        local c = imgui.GetCursorPos()
        imgui.SetCursorPos(imgui.ImVec2(c.x - iconSize.x * 1.5, c.y + size.y / 2 - iconSize.y / 2))
        imgui.TextWithShadow(icon, imgui.ImVec4(1, 1, 1, 1), 4, imgui.ImVec4(0, 0, 0, 0.3), false)
        imgui.SetCursorPos(c)
    end
    --dl:AddText(imgui.ImVec2(p.x - iconSize.x * 1.5, p.y + size.y / 2 - iconSize.y / 2), imgui.GetColorU32Vec4(iconColor), icon)

    if drawValue and s.bars_display_value[0] then
        imgui.PushFont(FONT[16].b)
        local valueSize = imgui.CalcTextSize(tostring(value))
        local c = imgui.GetCursorPos()
        imgui.SetCursorPos(imgui.ImVec2(c.x + size.x + 6, c.y + size.y / 2 - valueSize.y / 2))
        imgui.TextWithShadow(tostring(value), imgui.ImVec4(1, 1, 1, 1), 4,  imgui.ImVec4(0, 0, 0, 0.3), false)
        imgui.SetCursorPos(c)
        imgui.PopFont()
        --dl:AddText(imgui.ImVec2(p.x + size.x + 6, p.y + size.y / 2 - valueSize.y / 2), imgui.GetColorU32Vec4(imgui.ImVec4(1, 1, 1, 1)), tostring(value))
    end
    
end

