function comma_value(n)
	local left,num,right = string.match(n,'^([^%d]*%d)(%d*)(.-)$')
	return left..(num:reverse():gsub('(%d%d%d)','%1 '):reverse())..right
end

function separator(text)
	if text:find("$") then
	    for S in string.gmatch(text, "%$%d+") do
	    	local replace = comma_value(S)
	    	text = string.gsub(text, S, replace)
	    end
	    for S in string.gmatch(text, "%d+%$") do
	    	S = string.sub(S, 0, #S-1)
	    	local replace = comma_value(S)
	    	text = string.gsub(text, S, replace)
	    end
	end
	return text
end

function imgui.TextWithShadow(text, color, shadowSize, shadowColor, center)
    if center then
        imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - imgui.CalcTextSize(text).x / 2)
    end
    local shadowColor = shadowColor or imgui.ImVec4(0, 0, 0, 0)
    local c = imgui.GetCursorPos()
    if shadowSize > 0 then
        imgui.SetCursorPos(imgui.ImVec2(c.x - shadowSize / 2, c.y))
        imgui.TextColored(shadowColor, text)
        
        imgui.SetCursorPos(imgui.ImVec2(c.x + shadowSize / 2, c.y))
        imgui.TextColored(shadowColor, text)
        
        imgui.SetCursorPos(imgui.ImVec2(c.x, c.y - shadowSize / 2))
        imgui.TextColored(shadowColor, text)

        imgui.SetCursorPos(imgui.ImVec2(c.x, c.y + shadowSize / 2))
        imgui.TextColored(shadowColor, text)
    end
    imgui.SetCursorPos(c)
    imgui.TextColored(color or imgui.ImVec4(1, 1, 1, 1), text)
end

function getAmmoInClip()
    local pointer = getCharPointer(playerPed)
    local weapon = getCurrentCharWeapon(playerPed)
    local slot = getWeapontypeSlot(weapon)
    local cweapon = pointer + 0x5A0
    local current_cweapon = cweapon + slot * 0x1C
    return memory.getuint32(current_cweapon + 0x8)
end

function imgui.WeaponSlot(dl, data, size)
    if data.id > 1000 then data.id = 0 end
    local c = imgui.GetCursorPos()
    if getCurrentCharWeapon(PLAYER_PED) == data.id then
        imgui.SetCursorPos(imgui.ImVec2(c.x, c.y - 10))
    end
    local p = imgui.GetCursorScreenPos()
    --local dl = imgui.GetWindowDrawList()

    dl:AddRectFilled(p, imgui.ImVec2(p.x + size.x, p.y + size.y), imgui.GetColorU32Vec4(imgui.ImVec4(0, 0, 0, 0.3)), 5)
    
    if getCurrentCharWeapon(PLAYER_PED) == data.id or getCurrentCharWeapon(PLAYER_PED) == 0 and slot == 0 then
        dl:AddRect(p, imgui.ImVec2(p.x + size.x, p.y + size.y), imgui.GetColorU32Vec4(imgui.ImVec4(1, 1, 1, 1)), 5)
    end

    imgui.BeginChild('weaponslot:'..tostring(data.id), size, false, imgui.WindowFlags.NoScrollbar + imgui.WindowFlags.NoScrollWithMouse)
    if slotsIcons[data.id] == nil then
        if doesFileExist(iconsPath..'\\'..data.id..'.png') then
            slotsIcons[data.id] = imgui.CreateTextureFromFile(iconsPath..'\\'..data.id..'.png')
        else
            imgui.CenterText(weapons.get_name(data.id) or 'unknown: '..tostring(data.id))
        end
    else
        imgui.SetCursorPos(imgui.ImVec2(2, 2))
        imgui.Image(slotsIcons[data.id], imgui.ImVec2(size.x - 4, size.y - 4))
    end
    imgui.EndChild()
end

function imgui.CenterText(text)
    imgui.SetCursorPosX(imgui.GetWindowSize().x / 2 - imgui.CalcTextSize(text).x / 2)
    imgui.Text(text)
end

function main()
    while not isSampAvailable() do wait(0) end
    sampRegisterChatCommand('cfn', function()
        settingsWindow[0] = not settingsWindow[0]
    end)
    while true do
        wait(0)
        barsWindow[0] = renderWindow[0]
        renderWindow[0] = s.enabled[0]
        displayHud(s.enabled[0])
        result, id_p = sampGetPlayerIdByCharHandle(PLAYER_PED)
		nickname = sampGetPlayerNickname(id_p)
		online = sampGetPlayerCount(false)
    end
end

