function imgui.CE4(text, var)
    local ce = imgui.ColorEdit4('##'..text, var, imgui.ColorEditFlags.NoInputs + imgui.ColorEditFlags.AlphaBar)
    imgui.SameLine()
    imgui.Text(text)
    return ce
end

